import React from 'react';
import './App.css';
import ListOfImages from "./technologies/images";
import {Input} from "nav-frontend-skjema";
import docker from './technologies/images/docker.png';

function App() {
    return (
        <div className="App">
            <img src={docker} className="logo-container"/>

            <Input/>

        </div>
    );
}

export default App;
